/* VCD dumping functions */
MOD_mkTb_TTPoE & mkTb_TTPoE_backing(tSimStateHdl simHdl)
{
  static MOD_mkTb_TTPoE *instance = NULL;
  if (instance == NULL)
  {
    vcd_set_backing_instance(simHdl, true);
    instance = new MOD_mkTb_TTPoE(simHdl, "top", NULL);
    vcd_set_backing_instance(simHdl, false);
  }
  return *instance;
}
